import React, {Fragment} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    backgroundColor: theme.palette.background.paper,
  },
}));

const useStylesHitItem = makeStyles((theme) => ({
  root: {
    minWidth: 275,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  }
}));

function HitItem(i, model){
	//const classes = useStylesHitItem();
	return (
		<Card  boxShadow="none">
			  <CardContent>
				<Typography color="textSecondary" gutterBottom>
				  {model.prob}
				</Typography>
				<Typography variant="h6" component="h5">
				  {model.text}
				</Typography>
			  </CardContent>
		</Card>		
	);
}
export default function ListDividers(props) {
	const classes = useStyles();

	const tags = props.tags;
	//const probs = props.probs;
	const listItems = tags.map((model, i) => HitItem(i, model));
	/*const listItems = tags.map((each_tag, i) => {
		return 	<Fragment key={i}> 
					<ListItem button> 
						<ListItemText primary={each_tag} />
					</ListItem>
					<Divider />

				</Fragment>
	});*/
	return (
		<List component="nav" className={classes.root} aria-label="mailbox folders">
		  {listItems}
		</List>
  );
}

